local m = { 
    __index = function(t, k) 
        if k == "toObject" then
            return function()  
                local o = {}
                for key, v in pairs (__key_map) do 
                    o[key] = t._raw[v]
                end
                return o
            end 
        end
        
        assert(__key_map[k], "cannot find " .. k .. " in record_dungeon_stage_info")

        return t._raw[__key_map[k]]
    end
}


function dungeon_stage_info.getLength()
    return #dungeon_stage_info._data
end



function dungeon_stage_info.hasKey(k)
  if __key_map[k] == nil then
    return false
  else
    return true
  end
end


---
--@return @class record_dungeon_stage_info
function dungeon_stage_info.indexOf(index)
    if index == nil or not dungeon_stage_info._data[index] then
        return nil
    end
    return setmetatable({_raw = dungeon_stage_info._data[index]}, m)
end



---
--@return @class record_dungeon_stage_info
function dungeon_stage_info.get(id)
    
    return dungeon_stage_info.indexOf(__index_id[ id ])
     
end



function dungeon_stage_info.set(id, key, value)
    local record = dungeon_stage_info.get(id)
    if record then
        local keyIndex = __key_map[key]
        if keyIndex then
            record._raw[keyIndex] = value
        end
    end
end




function dungeon_stage_info.get_index_data()
    return __index_id 
end

return  dungeon_stage_info 